title: རྒྱལ་བ་རྒྱ་མཚོའི་མངོན་རྟོགས་སོགས།
alternative-title:
- རྒྱལ་བ་རྒྱ་མཚོའི་མངོན་རྟོགས།
- རྒྱལ་བ་རྒྱ་མཚོའི་མངོན་རྟོགས་དང། བཅོམ་ལྡན་འདས་པདྨ་ཟབ་པའི་མངོན་རྟོགས་ཚིག་ལྷུག་མ། རྒྱལ་བ་རྒྱ་མཚོའི་དབང་ཆོག་དྲི་མ་མེད་པའི་དོན་བསྡུས།
  རྒྱལ་བ་རྒྱ་མཚོའི་དབང་ཆོག། རྒྱལ་བ་རྒྱ་མཚོའི་དབང་བསྐུར་དང་ཚོགས་མཆོད་ཀྱི་ལག་ལེན།
